import React, { Component } from "react";
import "tabler-react/dist/Tabler.css";
import './Dashboard.scss';
import { Card } from "tabler-react";

class Dashboard extends React.Component {
    constructor(props){
        super(props)
        this.location = window.location.pathname
        this.onClick = this.props.onClick;
    }

    renderSwitch(location) {
      alert(window.location.pathname)
      this.location = 'dashboard'
      switch(location){
        case 'dashboard':
          return (
            <div className="dashboard">
          <Card
            title="Card title"
            body={`Lorem ipsum dolor sit amet, consectetur adipisicing elit. Aperiam
            deleniti fugit incidunt, iste, itaque minima neque pariatur
            perferendis sed suscipit velit vitae voluptatem. A consequuntur,
            deserunt eaque error nulla temporibus!`}
          />
          <Card
            title="Card title"
            body={`Lorem ipsum dolor sit amet, consectetur adipisicing elit. Aperiam
            deleniti fugit incidunt, iste, itaque minima neque pariatur
            perferendis sed suscipit velit vitae voluptatem. A consequuntur,
            deserunt eaque error nulla temporibus!`}
          />
          </div>
          )
        break;

        default: 
          return(
            <div className="undefined">
              <h1>You probably shouldn't be here - get out!</h1>  
            </div>
          )
      }
    }
    

  render() {
    return (
      <div className="dashboard-main">
        {this.renderSwitch(this.location)}
      </div>
    );
  }
}

export default Dashboard;
